(function(global, OBX){
    OBX.utils.ax = {
        extend: function () {
            args = arguments;
            if(args.length == 0) return false;
            if(!OBX.utils.dataType.isObj(args[0])) return false;
            for(var i = 1; i < args.length; i++){
                if(!OBX.utils.dataType.isObj(args[i])) return false;
                this.extend_obj(args[0], args[i]);
            }
            return args[0];
        },

        extend_obj: function(o1, o2){
            for(x in o2){
                if(OBX.utils.dataType.isObj(o2[x])){
                    if(typeof o1[x] == 'undefined' || !OBX.utils.dataType.isObj(o1[x])) o1[x] = {};
                    this.extend_obj(o1[x], o2[x]);
                }else if(OBX.utils.dataType.isArray(o2[x])){
                    if(typeof o1[x] == 'undefined'){
                        o1[x] = o2[x];
                    }else{
                        o1[x] = dateType.isArray(o1[x])? o1[x].concat(o2[x]) : o2[x];
                    }
                }else{
                    o1[x] = o2[x];
                }
            }
        },

        getElement: function(ele, index){
            index = OBX.utils.dataType.isNum(index)? index : 0;
            if(typeof ele == 'object' && ele.nodeType) return ele;
            if(!OBX.utils.dataType.isString(ele) || ele == '') return null;

            var eles = document.querySelectorAll(ele);
            return eles.length == 0? null : (index == -1? eles : eles[index]);
        },

        version_compare: function(v1, v2){
            var arr1 = v1.split('.'), arr2 = v2.split('.'), i = 0, int1, int2;
            for(; i < arr1.length && i < arr2.length; i++){
                int1 = parseInt(arr1[i]);
                int2 = parseInt(arr2[i]);
                if(int1 == int2) continue;
                return int1 > int2? 1:-1;
            }

            if(arr1.length == arr2.length){
                return 0;
            }else{
                var arr = arr1.length>arr2.length? arr1 : arr2;
                for(; i<arr.length; i++){
                    if(parseInt(arr[i]) != 0) return arr1.length>arr2.length? 1 : -1;
                }
                return 0;
            }
            //return arr1.length == arr2.length? 0:(arr1.length>arr2.length? 1:-1);
        },

        getDateTime: function(){
            var now = new Date(),
                y = now.getFullYear(),
                m = now.getMonth()+1,
                d = now.getDate(),
                h = now.getHours(),
                i = now.getMinutes(),
                s = now.getSeconds();
            return y+'-'+(m>=10? m:'0'+m)+'-'+(d>=10? d:'0'+d)+' '+(h>=10? h:'0'+h)+':'+(i>=10? i:'0'+i)+':'+(s>=10? s:'0'+s);
        },

        dateToArr: function(d){
            var darr = d.match(/^([0-9]{4})\-0?([0-9]+)\-0?([0-9]+)\s0?([0-9]+):0?([0-9]+):0?([0-9]+)$/);
            if(darr == null) return false;
            var i = 1, len = 6, arr = [], dat;
            for(; i <= len; i++){
                dat = typeof darr[i] != 'undefined'? (i==2? darr[i]-1:darr[i]):1;
                arr.push(dat);
            }
            return arr;
        },

        in_array: function(val, arr, strict){
            strict = typeof strict == 'undefined'? false:strict;
            for(var i = 0; i<arr.length; i++){
                if(!strict && val == arr[i]) return true;
                if(strict && val === arr[i]) return true;
            }
            return false;
        },

        str_participle: function(str){
            var red = new RegExp('(to|a|the|an)\\s+', 'g'), arr = [];
            str = str.trim();
            str = str.toLowerCase().replace(red, '');
            str = str.replace(/\s+/g, ',');
            arr = arr.concat(str.split(','));
            return arr;
        },

        words_in_str_count: function(words, str){
            var count = 0;
            for(var i = 0; i < words.length; i++){
                if(str.indexOf(words[i]) != -1) count++;
            }
            return count;
        },

        search_filter: function(searchstr, tools){
            var searcharr = OBX.utils.ax.str_participle(searchstr),
                accurate = [], blur = [[], [], []], mc, i = 0;
            for(; i < tools.length; i++){
                if(tools[i].show && tools[i].show == 0) continue;
                str = tools[i].name.toLowerCase() + tools[i].keywords.toLowerCase();
                if(str.indexOf(searchstr) != -1){
                    accurate.push(tools[i]);
                }else{
                    if(searcharr.length > 0 && (mc = OBX.utils.ax.words_in_str_count(searcharr, str))>0){
                        mc = mc > 3? 2 : mc-1;
                        blur[mc].push(tools[i]);
                    }
                }
            }
            return accurate.concat(blur[2], blur[1], blur[0]);
        }
    };
})(window, window.WOFFICEBOX);
(function(global, OBX){
    OBX.utils.dataType = {
        getType: function(d){
            var type = Object.prototype.toString.call(d),
                m = type.toLowerCase().match(/\[object\s([a-z]+)\]/);
            return m? m[1]:'unknown'
        },

        isString: function(d){return this.getType(d) == 'string'? true:false},

        isArray: function(d){return this.getType(d) == 'array'? true:false},

        isObj: function(d){return this.getType(d) == 'object'? true:false},

        isNum: function(d){return this.getType(d) == 'number'? true:false},

        isFunc: function(d){return this.getType(d) == 'function'? true:false},

        isBool: function(d){return this.getType(d) == 'boolean'? true:false},

        isUndefined: function(d){return this.getType(d) == 'undefined'? true:false},

        isNull: function(d){return this.getType(d) == 'null'? true:false},

        isElement: function(d){return this.getType(d) == 'object' && d.nodeType? true : false},

        isUrl: function(d){return this.getType(d) == 'string'? (d.toLowerCase().match(OBX.utils.regExp.url)? true : false) : false},

        isFile: function(d){return this.getType(d) == 'string'? (d.toLowerCase().match(OBX.utils.regExp.file)? true : false) : false}
    };
})(window, window.WOFFICEBOX);
(function(global, OBX){
    OBX.utils.http = {
        httpBuildQuery: function(obj){
            var query = [], i = 0, data;
            for(x in obj){
                data = OBX.utils.dataType.isObj(obj[x]) || OBX.utils.dataType.isArray(obj[x])? JSON.stringify(obj[x]) : obj[x];
                query[i++] = x + '=' + encodeURIComponent(data);
            }
            return query.join('&');
        },

        getLocalData: function(filename, onsuccess, onerr){
            if(global.DEVELOP){
                global.getLocalData(filename, onsuccess, onerr);
            }else{
                var data = global.getLocalData(filename);
                try {
                    var json = JSON.parse(data)
                    onsuccess(json)
                }catch(e){
                    onerr()
                }
            }
        },

        saveLocalData: function(filename, data){
            global.saveLocalData(filename, JSON.stringify(data));
        },

        localData_exists: function(filename){
            var exists = false,
                onsuccess = function(d){
                    exists = d? JSON.parse(d) : false;
                },
                onerr = function(){};
            if(global.DEVELOP){
                global.getLocalData(filename, onsuccess, onerr);
            }else{
                var data = global.getLocalData(filename);
                data? onsuccess(data) : onerr();
            }
            return exists;
        },

        getRemoteData: function(url, onsuccess, onerr){
            $.ajax({
                url: url,
                type: 'get',
                dataType: 'json',
                cache: false,
                success: function(d){
                    if(typeof onsuccess == 'function') onsuccess(d);
                },
                error: function(){
                    if(typeof onerr == 'function') onerr();
                },
                async: true
            })
        },

        /*
        * appdata
        * @filename 
        * @path  http | cloud-tempalte://
        * */
        downloadFileToAPPDATA: function(filename, path){
            if(global.downloadFileToDataFolder){
                try {
                    global.downloadFileToDataFolder(filename, path);
                }catch(e){
                    console.log(e)
                }
            }else{
                console.log(arguments);
            }
        }
    };
})(window, window.WOFFICEBOX);


