(function(global){
    var myconfig = {
        filter: {
            asTrustedHtml: [
                '$sce',
                function($sce){
                    return function(v){return $sce.trustAsHtml(v);} //html
                }
            ],
            asTrustedUrl: [
                '$sce',
                function($sce){
                    return function(v){return $sce.trustAsUrl(v);} //html
                }
            ]
        },
        config: {
            post: function($httpProvider){ //jquery post
                $httpProvider.defaults.headers.post['Content-Type'] = 'application/x-www-form-urlencoded;charset=utf-8';
                var param = function(obj) {
                    var query = '', name, value, fullSubName, subName, subValue, innerObj, i;

                    for(name in obj) {
                        value = obj[name];

                        if(value instanceof Array) {
                            for(i=0; i<value.length; ++i) {
                                subValue = value[i];
                                fullSubName = name + '[' + i + ']';
                                innerObj = {};
                                innerObj[fullSubName] = subValue;
                                query += param(innerObj) + '&';
                            }
                        }
                        else if(value instanceof Object) {
                            for(subName in value) {
                                subValue = value[subName];
                                fullSubName = name + '[' + subName + ']';
                                innerObj = {};
                                innerObj[fullSubName] = subValue;
                                query += param(innerObj) + '&';
                            }
                        }
                        else if(value !== undefined && value !== null)
                            query += encodeURIComponent(name) + '=' + encodeURIComponent(value) + '&';
                    }

                    return query.length ? query.substr(0, query.length - 1) : query;
                };

                // Override $http service's default transformRequest
                $httpProvider.defaults.transformRequest = [function(data) {
                    return angular.isObject(data) && String(data) !== '[object File]' ? param(data) : data;
                }];
            }
        },

        //
        directive: {
            errSrc: function(){ //
                return {
                    link: function(scope, element, attrs){
                        element.bind('error', function() {
                            if (attrs.src != attrs.errSrc) {
                                attrs.$set('src', attrs.errSrc);
                            }
                        });
                    }
                }
            }
        }
    };

    function Ax_ngConfig(opts){
        if(!(opts instanceof Object)) return;
        if(typeof opts.ng == 'undefined') return;
        if(typeof opts.options == 'undefined') return;
        this.opts = opts;
        this.ng = opts.ng;
        this.init();
    };

    Ax_ngConfig.prototype = {
        init: function(){
            for(x in this.opts.options){
                switch(x){
                    case 'directive':
                        this.ngDirective(this.opts.options[x]);break;
                    case 'filter':
                        this.ngFilter(this.opts.options[x]);break;
                    case 'config':
                        this.ngConfig(this.opts.options[x]);break;
                    default: break;
                }
            }
        },

        ngDirective: function(directive){
            var x = 0, y;
            for(; x < directive.length; x++){
                y = directive[x];

                if(typeof myconfig.directive[y] != 'undefined'){
                    this.ng.directive(y, myconfig.directive[y]);
                }
            }
        },

        ngFilter: function(filter){
            var x = 0;
            for(; x < filter.length; x++){
                if(typeof myconfig.filter[filter[x].tar] != 'undefined'){
                    this.ng.filter(filter[x].name, myconfig.filter[filter[x].tar]);
                }
            }
        },

        ngConfig: function(config){
            var x = 0;
            for(; x < config.length; x++){
                if(typeof myconfig.config[config[x]] != 'undefined'){
                    this.ng.config(myconfig.config[config[x]]);
                }
            }
        }
    };

    global.NGEXTEND = Ax_ngConfig;
})(window);
